/*! PXL loader (JS manifest) */
(function(w,d){
  function load(u){var s=d.createElement("script");s.src=u;s.async=true;d.head.appendChild(s)}
  var m=d.createElement("script");
  m.src="https://cdn.jsdelivr.net/gh/randyforseth-spec/lovelife@main/pixel-manifest.js?ts="+Date.now();
  m.onload=function(){ if(w.PXL_URL){ load(w.PXL_URL) } else { console.error("PXL: manifest missing PXL_URL") } };
  m.onerror=function(e){ console.error("PXL: manifest load failed",e) };
  d.head.appendChild(m);
})(window,document);
